    [],nt"num_tags": 10,nt"name": "genetic-variation-within-and-among-populations-of-delmarva-fox-squirrels",nt"isopen":
    false,nt"url": null,nt"notes": "The objective of this study was to provide
    important information about genetic variation in populations of the Delmarva Fox
    Squirrel in the context of a more general (and hence more informative) survey of
    electrophoretic variation in other populations of fox squirrels. This report compares
    genetic variation within and among a total of 19 populations of fox squirrels using
    data from horizontal starch-gel electrophoresis. The focus was populations of Delmarva
    fox squirrels from the Eastern Shore of Maryland and Virginia (Blackwater National
    Wildlife Refuge and Chincoteague National Wildlife Refuge) as well as other populations
    of eastern fox squirrels from Maryland, Virginia, and Georgia.",nt"owner_org":
